userDefinedLinkHintCss:
div > .vimiumHintMarker {
    background: #2E3440;
    border: 0;
}

div.internalVimiumHintMarker {
    border-radius: 4px; 
    box-shadow: none;
    padding: 4px 6px;
}

div > .vimiumHintMarker span {
    color: #ECEFF4;
    font-weight: normal;
    font-size: 12px;
}

div.internalVimiumHintMarker > .matchingCharacter {
    color: #81A1C1;
}
